si[i++] = gsitm("M401000200157300ENG.html", "BODY MAIN CROSS-SECTIONAL VIEWS", "title");
si[i++] = gsitm("M401000500288700ENG.html", "SILENCER APPLICATION LOCATIONS", "title");
si[i++] = gsitm("M401000500288700ENG.html", "Silencers have been added on the cowl top panel and the floor in order to suppress vibration and noise.", "ptxt");
si[i++] = gsitm("M401001800058000ENG.html", "LOCATIONS USING URETHANE FOAM AND FOAM MATERIAL", "title");
si[i++] = gsitm("M401001800058000ENG.html", "The sound dampening foam material may burn when heated. Always observe the following instructions:", "ptxt");
si[i++] = gsitm("M401001800058000ENG.html", "Never use a gas burner to burn the areas where sound dampening foam material are used.", "ptxt");
si[i++] = gsitm("M401001800058000ENG.html", "When cutting the parts which are provided with sound dampening foam material, ensure to use tools (air saw, etc.) that do not generate fire.", "ptxt");
si[i++] = gsitm("M401001800058000ENG.html", "If there are residual sound dampening foam material remaining on the cut section (body side), remove the sound dampening foam material from periphery of the welding area before welding work.", "ptxt");
si[i++] = gsitm("M401001800058000ENG.html", "The sound dampening foam material has been adopted to the front pillar section, roof side rail section and wheel house arch to shield from external noise.", "ptxt");
si[i++] = gsitm("M401001800058000ENG.html", "Urethane foam has been inserted into the front pillar lower section, centre pillar lower section and quarter inner inside to shield from external noise.", "ptxt");
si[i++] = gsitm("M401000170017800ENG.html", "STIFFENER APPLICATION LOCATIONS", "title");
si[i++] = gsitm("M401000170017800ENG.html", "Sheet-type stiffeners on the inner side of the hood outer panel and side outer panel (Right side) have been used for higher surface rigidity.", "ptxt");
si[i++] = gsitm("M401000170017800ENG.html", "The main contents of a stiffener are epoxy resin. It comes in a sheet form and contains a mixture of glass fibre and filler, and cures (stiffens) when heated.", "ptxt");
si[i++] = gsitm("M401000170017800ENG.html", "No spare part of the stiffener for repair is available in the field. If the stiffener is damaged, replace it together with the panel.", "ptxt");
si[i++] = gsitm("M402000100061901ENG.html", "BODY DIMENSIONS AND MEASUREMENT METHODS", "title");
si[i++] = gsitm("M402000100061901ENG.html", "Type A (projected dimensions) is the dimension when a measurement location is projected onto the plane.", "ptxt");
si[i++] = gsitm("M402000100061901ENG.html", "The height indicates a distance from the assumed standard line established 100 mm below the lowest measurement point.", "ptxt");
si[i++] = gsitm("M402000100061901ENG.html", "Type B (actual-measurement dimensions) is the actual distance between the measurement points. Measure using a tracking gauge or a measuring tape, etc.", "ptxt");
si[i++] = gsitm("M402000100061901ENG.html", "Make the lengths of the tracking gauge probes the same (A=A’).", "ptxt");
si[i++] = gsitm("M402000100061901ENG.html", "Do not bend or twist the measuring tape.", "ptxt");
si[i++] = gsitm("M402000100061901ENG.html", "Insert the tracking gauge probes securely into the measurement holes.", "ptxt");
si[i++] = gsitm("M402000100061901ENG.html", "When the standard dimensions in the illustration are enclosed by rectangle, this indicates that the symmetrical left and right positions have the same dimensions.", "ptxt");
si[i++] = gsitm("M402000100061901ENG.html", "When using a notch for dimension measurement, set the measuring point at the centre of the outer panel notch.", "ptxt");
si[i++] = gsitm("M402000100061901ENG.html", "When measuring the suspension mounting arm, or link mounting position, use the suspension mounting bolt, etc. (Type B only)", "ptxt");
si[i++] = gsitm("M402000100061901ENG.html", "The body centre points are shown for the purpose of checking the position of the left and right symmetry location.", "ptxt");
