si[i++] = gsitm("M403000280007301ENG.html", "ULTRA HIGH STRENGTH STEEL PLATE", "title");
si[i++] = gsitm("M403000280007301ENG.html", "ADVANTAGES OF ULTRA HIGH STRENGTH STEEL PLATE", "title");
si[i++] = gsitm("M403000280007301ENG.html", "The ultra high strength steel plate has the following advantages as compared with conventional high strength steel plate.", "ptxt");
si[i++] = gsitm("M403000280007301ENG.html", "It has tensile strength approximately 1.7 times higher than the conventional high strength steel sheet.", "ptxt");
si[i++] = gsitm("M403000280007301ENG.html", "It has a higher yielding point and yielding ratio (yielding point/tensile strength).", "ptxt");
si[i++] = gsitm("M403000280007301ENG.html", "These advantages allow thinner and lighter plates and better fuel efficiency than the high strength steel plate.", "ptxt");
si[i++] = gsitm("M403000280007301ENG.html", "PRECAUTION UPON MAINTENANCE OF ULTRA HIGH STRENGTH STEEL PLATE", "title");
si[i++] = gsitm("M403000280007301ENG.html", "Use a spot cutter for ultra high strength steel plate to ensure that the spot-welded area is cut off. The following tools are recommended.", "ptxt");
si[i++] = gsitm("M403000280007301ENG.html", "Drill bit, spot weld cutter (8) (Tool number: MB992621)", "ptxt");
si[i++] = gsitm("M403000280007301ENG.html", "For the part in which the ultra high strength steel plate is used, do not repair it by cutting and bonding to avoid the reduction in strength by heat. Instead, replace the whole assembly including the part.", "ptxt");
si[i++] = gsitm("M403000280007301ENG.html", "Be careful with rough extending work, because the ultra high strength steel plate has higher tensile strength and a higher yielding point than high strength steel plate and general steel plate. Careless work will cause symptom such as over-pulling and springback. Do not extend it completely at a time. Do it gradually while removing the distortion by sheet metal processing with a hammer.", "ptxt");
si[i++] = gsitm("M403000280007301ENG.html", "Plug welding of Φ 8 mm diameter plug for repair ensures the strength equivalent to spot welding for 2 steel sheets. For 3 sheets, weld 2 sheets each time from both sides instead of welding from one side to give sufficient welding strength.", "ptxt");
