si[i++] = gsitm("M404000100288800ENG.html", "BODY SEALING LOCATIONS", "title");
si[i++] = gsitm("M404000100288800ENG.html", "If the sealant application is directly visible on the outer plate and requires appearance quality of the application in areas such as the drip rail, pillar, clinch and so on, then apply the sealant so that it is flat, or wipe off any excess mounding after the application. Be careful not to obstruct the water draining hole.", "ptxt");
