si[i++] = gsitm("M40400020A000400ENG.html", "ANTICORROSION PRIMER LOCATIONS", "title");
si[i++] = gsitm("M40400020A000400ENG.html", "To prevent rusting from chipping (flying rock), an anticorrosion primer has been applied to the areas indicated in the figure of the side sill.", "ptxt");
si[i++] = gsitm("M40400020A000400ENG.html", "The primer is applied between the under and middle coat. It improves anti-corrosive performance by preventing flying rock to damage the body panel with the primer application, according to the thickness and elasticity of the primer. Apply the primer before the middle coat when replacing the panel complete with the primer application.", "ptxt");
si[i++] = gsitm("M40400020A000400ENG.html", "Primer: Rocker panel primer", "ptxt");
si[i++] = gsitm("M40400020A000400ENG.html", "Recommended primer:", "ptxt");
