si[i++] = gsitm("M404000300190000ENG.html", "UNDERCOAT APPLICATION LOCATIONS", "title");
si[i++] = gsitm("M404000300190000ENG.html", "The under parts of the body is undercoated for anti-corrosive, anti-rust, anti-chipping, and anti-vibration performance.", "ptxt");
si[i++] = gsitm("M404000300190000ENG.html", "After correcting the body, restore as shown in the instructions of the figure, if necessary.", "ptxt");
si[i++] = gsitm("M404000300190000ENG.html", "To avoid splashing of undercoat material during the coating, protect the plug holes and components installation holes with masking tape.", "ptxt");
si[i++] = gsitm("M404000300190000ENG.html", "Do not splash undercoat materials onto the portions marked with *. The portions marked with * have drain holes.", "ptxt");
si[i++] = gsitm("M404000800031100ENG.html", "WAX INJECTION LOCATIONS", "title");
si[i++] = gsitm("M404000800031100ENG.html", "In order to provide greater corrosion resistance, wax injection has been performed for the lower areas of the vehicle. If any of these panels are replaced, wax injection must be performed for the new parts.", "ptxt");
si[i++] = gsitm("M404000800031100ENG.html", "Recommended wax:", "ptxt");
